import React, { Component } from 'react';
import Projects from './Projects';
import SocialProfiles from './SocialProfiles';

class App extends Component {

    state = { displayBio: false }

    render() {
        return (
            <div>
                <h1>Hello</h1>
                <p>My name is Klaudia. I'm a software engineer.</p>
                <p>Mobile Development, Web Development, Game Development</p>
                <button onClick={this.toggleBio}>Read more</button>
                {
                    this.state.displayBio ? (
                        <div>
                            <p>This is more information about me</p>
                        </div>
                    ) : null
                }
                <hr />
                <Projects />
                <SocialProfiles />
            </div>
        )
    }

    //this syntax binds function to 'this'
    //equivalent to writing this.toggleDisplayBio = () => {...}
    // in the constructor
    toggleBio = () => {
        this.setState({ displayBio: !this.state.displayBio });
    }
}

export default App;
